             name : "",
             task : ""
        }
    }


    getComponent(){
        console.log("king");
    }

    render() {
        return (
            <div>
                <h1>Person Manager</h1>
                <h5>This is my task</h5>
                <button onClick = {this.getComponent.bind(this)} label="Action" >Click me</button>
                <form>
        <h1>{this.state}</h1>
                    <input placeholder = "name" name = {this.state.name}/>
                    <input placeholder = "task" name = {this.state.name}/>
                </form>
            </div>
        )
    }
}

export default Page
